INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (0, "ねぇねぇ、騎士クン\n手伝ってあげようよ～", 1, 2, 1.4, 0, "春咲 ひより", 1001, 0, "お！\nあそこに困ってそうな人発見！", 1, "ヒヨリでっす♪\n元気いっぱいがんばるよ♪", 1, 0, 0);
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (0, "わ、わたし、\nなに言ってるんだろ\nあはは…", 1, 2, 1.4, 0, "草野 優衣", 1002, 0, "大切な人を\n守れるようになりたい…って", 1, "みんなみたいに\nわたしも強くならなきゃ", 1, 0, 0);
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (0, "少しは磨かれると思いますよ。", 1, 2, 1.4, 0, "士条 怜", 1003, 0, "キミに必要な集中力と感性が", 1, "フェンシングを始めてみては？", 1, 0, 0);
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (0, "みそぎはねぇ、\nかくれんぼやりたい！", 1, 2, 1.5, 0, "穂高 みそぎ", 1004, 0, "今日はなにして遊ぶ？", 1, "ねぇ、にいちゃん！", 1, 0, 0);
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (0, "私といっしょに…\nいかない？", 1, 2, 1.4, 0, "風宮 あかり", 1006, 0, "ねぇ…", 1, "風宮あかりです", 1, 0, 0);
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (0, "食べ物の恨みは怖いのー", 1, 2, 1.5, 0, "出雲 宮子", 1007, 0, "プリンたべたいのー", 1, "出雲宮子なのー", 1, 0, 0);
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (0, "いいよ。\n見られることは運命さ…", 1, 2, 1.4, 0, "虹村 雪", 1008, 0, "キミもボクの美貌に\n吸い寄せられたんだね。", 1, "ボクは虹村雪。", 1, 0, 0);
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (0, "人呼んで「疾風の冥姫」!!", 1, 2, 1.4, 0, "柊杏奈", 1009, 0, "我が真名は\nアンネローゼ・フォン・シュテッヒパルム！", 1, "フッ…聞いて後悔するがいい！", 1, 0, 0);
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (0, "ほんまおおきにやわ～♪", 1, 2, 1.5, 0, "姫宮 真歩", 1010, 0, "うさぎさん、\n運命の王子はんに巡りあわせてくれて", 1, "マホマホ王国のプリンセス、\nまほ姫どす", 1, 0, 0);
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (0, "ここで会ったが\n100年目～！", 1, 2, 1.4, 0, "衣之咲 璃乃", 1011, 0, "生き別れたお兄ちゃんを探して\n三千世界！", 1, "衣之咲璃乃です！", 1, 0, 0);
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (0, "…って、お願い！\n誰にも言わないでおいて～！", 1, 2, 1.4, 0, "柏崎 初音", 1012, 0, "ち、超能力って…\n何のことかな～？", 1, "私はハツネ、\n結構強いんだよ。\nきらーん☆", 1, 0, 0);
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (0, "ヒデサイまぢ\nGF（グッドフィーリング）～♪", 1, 2, 1.4, 0, "美波 鈴奈", 1016, 0, "一応カリスマ読モJKやってまっす！", 1, "ちょす！\n美波鈴奈だよ～♪", 1, 0, 0);
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (0, "でも、沖縄もとってもいいとこさー", 1, 2, 1.4, 0, "喜屋武 香織", 1017, 0, "東京は遊園地みたいなところさー", 1, "はいたーい。\n喜屋武香織さー。", 1, 0, 0);
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (0, "イオちゃんって呼んでね。", 1, 2, 1.4, 0, "支倉 伊緒", 1018, 0, "先生って呼ばれるのは\nくすぐったいから", 1, "支倉伊緒です。", 1, 0, 0);
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (0, "ミミをおいてかないでぇ～", 1, 2, 1.5, 0, "茜 ミミ", 1020, 0, "あ！/\お兄ちゃ～ん\nまってよ～", 1, "ふえ…？\nミミ、むずかしいこと\nよくわかんない…", 1, 0, 0);
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (0, "ふぇぇぇぇぇん……", 1, 2, 1.5, 0, "栗林 くるみ", 1021, 0, "あの……\nふぇ……", 1, "あ…あの…えっと…\n栗…林…くるみ…です……", 1, 0, 0);
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (0, "なんてありがとうございます！", 1, 2, 1.4, 0, "風宮 より", 1022, 0, "こんな私に貴重な時間を\n割いていただき、", 1, "風宮よりです。\nあああああ！", 1, 0, 0);
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (0, "私こっち行きたいー\nね、早く早くー", 1, 2, 1.5, 0, "北条 綾音", 1023, 0, "おにいちゃんどこいくの？\nえ？", 1, "私、アヤネ！\nぷうきちと一緒についてってあげるね！", 1, 0, 0);
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (0, "これて何か違う…\nあああすみません！", 1, 2, 1.4, 0, "天野 すずめ", 1025, 0, "ふ、不束者ですが\nどうぞ末永く…って、", 1, "わっ…わっ…私、\n天野すずめといいます！", 1, 0, 0);
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (0, "離しませんわ………\n絶対に…!!", 1, 2, 1.4, 0, "倉石 恵理子", 1027, 0, "あなたは…運命の……\n伴侶……", 1, "……クスクス…私は\n…倉石恵理子……", 1, 0, 0);
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (0, "…そうでしょ？？", 1, 2, 1.4, 0, "佐々木 咲恋", 1028, 0, "その無駄を省くことができれば、\nもっと余裕のある暮らしができるっ！", 1, "佐々木咲恋よ。\nねえ、世の中に無駄なことが\n多すぎると思わない？", 1, 0, 0);
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (0, "あはは、\n私もまだまだだなぁ～", 1, 2, 1.4, 0, "桜井 望", 1029, 0, "ぇっと…\nキミ、私のこと知らないの?!", 1, "桜井望だよ！\nよろしくねっ", 1, 0, 0);
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (0, "ショーグン、\nワタシと一緒に天下統一デース！", 1, 2, 1.4, 0, "ニノン・ジュベール", 1030, 0, "初めまして、\n私はニノン・ジュベール申すデス！", 1, "デケデケデンっ！", 1, 0, 0);
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (0, "おかしいですね……", 1, 2, 1.4, 0, "上喜 しのぶ", 1031, 0, "でもって私の隣にいるのが……\nえ、見えない？", 1, "上喜しのぶです。\n手元のドクロが父です。", 1, 0, 0);
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (0, "そう、\nオラのボケに突っ込める相方が…！", 1, 2, 1.5, 0, "野戸まひる", 1033, 0, "けんども\nそれには足りないモンが…", 1, "目指すはビッグな\nお笑い芸人だっぺ！", 1, 0, 0);
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (0, "ちょ\nちょっと一杯飲んできます…！", 1, 2, 1.4, 0, "綾瀬 ゆかり", 1034, 0, "ちょっと緊張しちゃって…", 1, "あの…私…綾瀬ゆかりです…\nあの…ごめんなさい！", 1, 0, 0);
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (0, "これ以上お話しすることは…\nないです！", 1, 2, 1.5, 0, "氷川 鏡華", 1036, 0, "知らない人とは話しちゃいけないので", 1, "氷川鏡華…です", 1, 0, 0);
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (0, "私体が弱いから、\n30分に一度休憩しないと\nいけないんです。", 1, 2, 1.4, 0, "柏崎 栞", 1038, 0, "……あ、アラーム。", 1, "柏崎…栞です。", 1, 0, 0);
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (0, "野に咲く花が、\n唯一の話相手です。", 1, 2, 1.4, 0, "双葉 碧", 1040, 0, "私、一人も友達がいなくて……", 1, "ふ、双葉碧です。", 1, 0, 0);
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (0, "そう思っています。", 1, 2, 1.4, 0, "三角 千歌", 1042, 0, "私の歌声で、\n皆さんが幸せになってくれたらいいなって…", 1, "三角千歌です。", 1, 0, 0);
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (0, "う、疑ってすまなかったな…", 1, 2, 1.4, 0, "安芸 真琴", 1043, 0, "あぁ？\nお前のそいつの仲間か？", 1, "安芸真琴だ。", 1, 0, 0);
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (0, "わらわの偉大な力に\nひれ伏すがいい！\nはっはっは！", 1, 2, 1.4, 0, "イリヤ・オーンスタイン", 1044, 0, "生けとし生ける全ての者よ！", 1, "わらわこそは夜を総べる者！", 1, 0, 0);
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (0, "ｌク、クウカに何かご用ですか!?", 1, 2, 1.4, 0, "遠見 空花", 1045, 0, "ぐふふふふ……はっ！", 1, "そこで騎士は妖精を乱暴に……", 1, 0, 0);
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (0, "う～ん…\n猫ってホントに最高にゃ～♪", 1, 2, 1.4, 0, "宮坂たまき", 1046, 0, "自由気ままで♪\n寝て遊んで、食べてケンカして…", 1, "宮坂たまきにゃ♪\n猫はいいにゃよ？", 1, 0, 0);
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (0, "…と思ったら\nバイトの時間だ！\nまたあとでね！", 1, 2, 1.4, 0, "大神 美冬", 1048, 0, "それでは早速クエストに…", 1, "大神美冬よ！", 1, 0, 0);
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (0, "お姉ちゃんがぜ～んぶ\nやってあげるからね！", 1, 2, 1.4, 0, "星野静流", 1049, 0, "クエストもバトルも\n掃除も洗濯も", 1, "星野静流だよ！", 1, 0, 0);
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (0, "学校では誰もが憧れる\nアイドル的な存在ってやつよ♪", 1, 2, 1.5, 0, "玉泉美咲", 1050, 0, "見ての通りの\nセクシー美少女で", 1, "アタシは玉泉美咲。", 1, 0, 0);
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (0, "？？？？", 1, 2, 1.4, 0, "リマ", 1052, 0, "？？？？", 1, "？？？", 1, 0, 0);
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (0, "そ、そこまでいうなら\nもらってやる", 1, 2, 1.5, 0, "モニカ・ヴァイスヴィント", 1053, 0, "菓子でつろうなどと\n稚拙な策を……", 1, "モニカ・ヴァイスヴィントだ。", 1, 0, 0);
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (0, "そ、そこまでいうなら\nもらってやる", 1, 2, 1.5, 0, "ペコリーヌ", 1058, 0, "菓子でつろうなどと\n稚拙な策を……", 1, "モニカ・ヴァイスヴィントだ。", 1, 0, 0);
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (0, "そ、そこまでいうなら\nもらってやる", 1, 2, 1.5, 0, "コッコロ", 1059, 0, "菓子でつろうなどと\n稚拙な策を……", 1, "モニカ・ヴァイスヴィントだ。", 1, 0, 0);
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (0, "そ、そこまでいうなら\nもらってやる", 1, 2, 1.5, 0, "キャル", 1060, 0, "菓子でつろうなどと\n稚拙な策を……", 1, "モニカ・ヴァイスヴィントだ。", 1, 0, 0);
